import React from 'react';
import { useNavigate } from 'react-router-dom';

function SwitzerlandTourDetails() {
  const navigate = useNavigate();

  const handleBooking = () => {
    navigate('/book-tour'); // Redirect to booking page
  };

  // Inline styles for the page components
  const styles = {
    page: {
      fontFamily: '"Arial", sans-serif',
      lineHeight: '1.6',
      color: '#333',
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '20px',
    },
    hero: {
      backgroundImage: 'url("https://www.planetware.com/photos-large/CH/switzerland-matterhorn.jpg")',
      backgroundSize: 'cover',
      height: '50vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      flexDirection: 'column',
      color: '#fff',
      textShadow: '1px 1px 8px rgba(0, 0, 0, 0.7)',
    },
    title: {
      fontSize: '2.5rem',
      fontWeight: 'bold',
      padding: '15px',
    },
    section: {
      margin: '20px 0',
    },
    list: {
      paddingLeft: '20px',
    },
    gallery: {
      display: 'grid',
      gridTemplateColumns: 'repeat(3, 1fr)',
      gap: '10px',
    },
    image: {
      width: '100%',
      height: '200px',
      objectFit: 'cover',
    },
    button: {
      backgroundColor: '#007bff',
      color: 'white',
      border: 'none',
      padding: '10px 20px',
      fontSize: '1rem',
      cursor: 'pointer',
      marginTop: '20px',
      transition: 'background-color 0.3s',
    },
    buttonHover: {
      backgroundColor: '#0056b3',
    }
  };

  return (
    <div style={styles.page}>
      <div style={styles.hero}>
        <h1 style={styles.title}>Discover Switzerland</h1>
        <p>Experience the beauty and precision of Swiss travel.</p>
      </div>
      <div style={styles.section}>
        <h2>Itinerary</h2>
        <p>Day 1: Arrival in Zurich - Explore the old town.</p>
        <p>Day 2: Visit Lucerne and Mount Titlis.</p>
        <p>Day 3: Day trip to Interlaken and the Jungfrau Region.</p>
        <p>Day 4: Departure.</p>
      </div>
      <div style={styles.section}>
        <h2>Inclusions</h2>
        <ul style={styles.list}>
          <li>All entry fees to attractions and museums</li>
          <li>Transportation by coach</li>
          <li>3 nights accommodation in a 4-star hotel</li>
          <li>Daily breakfast</li>
        </ul>
      </div>
      <div style={styles.section}>
        <h2>Exclusions</h2>
        <ul style={styles.list}>
          <li>International flights</li>
          <li>Travel insurance</li>
        </ul>
      </div>
      <div style={styles.section}>
        <h2>Pricing</h2>
        <p>Standard Package: $999 per person</p>
        <p>Luxury Package: $1999 per person</p>
      </div>
      <div style={styles.section}>
        <h2>Gallery</h2>
        <div style={styles.gallery}>
          <img style={styles.image} src="https://example.com/swiss-image1.jpg" alt="Lake Geneva" />
          <img style={styles.image} src="https://example.com/swiss-image2.jpg" alt="Bern" />
          <img style={styles.image} src="https://example.com/swiss-image3.jpg" alt="The Matterhorn" />
        </div>
      </div>
      <button
        style={styles.button}
        onMouseOver={e => e.currentTarget.style.backgroundColor = styles.buttonHover.backgroundColor}
        onMouseOut={e => e.currentTarget.style.backgroundColor = styles.button.backgroundColor}
        onClick={handleBooking}
      >
        Book Your Tour Now!
      </button>
    </div>
  );
}

export default SwitzerlandTourDetails;
